import React from 'react'

const VideoDetail = ({ video }) => {
    if (!video) {
        return <div></div>
    }
    const videoSource = `https://www.youtube.com/embed/${video.Id}`
    return <div className='columnLeft segmentBorder p-10 r-5'>
                <iframe src={videoSource}></iframe>
                <div className='greet color-yellow bold'>{video.title}</div>
                <div className='small white'>{video.description}</div>
            </div>
}

export default VideoDetail;
